import React, { PureComponent } from "react";
import {
  Radar,
  RadarChart,
  PolarGrid,
  PolarAngleAxis,
  PolarRadiusAxis,
} from "recharts";
import Data from "../Data/DimensionContent";

const data = Data;

export default class Example extends PureComponent {
  static jsfiddleUrl = "https://jsfiddle.net/alidingling/6ebcxbx4/";

  render() {
    return (
      <RadarChart
        cx={300}
        cy={250}
        outerRadius={150}
        width={300}
        height={300}
        data={data}
      >
        <PolarGrid />
        <PolarAngleAxis dataKey="subject" font-family="Prompt" />
        <PolarRadiusAxis />
        <Radar
          font-family="Prompt"
          name="บริบท"
          dataKey="d0"
          stroke="#8884d8"
          fill="#8884d8"
          fillOpacity={0.6}
        />
      </RadarChart>
    );
  }
}
